function Login(){}Login.prototype.listenLoginEvent=function(){$("#login-btn").click(function(n){n.preventDefault();var e=$(".telephone").val(),o=$(".password").val(),t=$("#remember").prop("checked");acajax.post({url:"/acauth/login/",data:{telephone:e,password:o,remember:t},success:function(n){window.location.replace("/")}})})},Login.prototype.run=function(){this.listenLoginEvent()},$(function(){(new Login).run()});